import React from 'react'
export default function DemoOneComponent() {
    let obj={firstname:"ABC",lastName:"PQR",gender:"Female",email:"abc@gmail.com"}
  return (
    <>
    <div>
        <h1>Functional Componenet in RJS</h1>
        <p>FirstName - {obj.firstname}</p>
        <p>LastName - {obj.lastName}</p>
        <p>Gender - {obj.gender}</p>
        <p>Email - {obj.email}</p>
    </div>
    </>
  )
}
